import React from 'react';
import logo from './logo.svg';
import './App.css';
import "./style.css";
import { useForm } from 'react-hook-form';

export default function App() {
  const { register, handleSubmit, errors } = useForm();
  const onSubmit = data => console.log(data);
  console.log(errors);

  return (
    <form onSubmit={handleSubmit(onSubmit)}>

  <p>Help us to build a library of products wanted by you.</p>

    <label htmlFor="link">Add URL:</label>
      <input type="link" placeholder="https://www.company.com/product" name="link"/>

  <p>Or simply add manually details of the product</p>



      <label htmlFor="brand">Brand:</label>
          <input id="brand" name="brand" type="text"/>

          <label htmlFor="product">Product:</label>
          <input id="product" name="product" type="text" />

           <label htmlFor="category">Category:</label>
          <input id="category" name="category" type="text"/>


      <input type="submit" />
    </form>
  );
}
